import React from 'react';

const WatermarkConfig = () => {
  return (
    <div style={{ padding: 32 }}>
      <h1>Configuración de Marca de Agua</h1>
      {/* Aquí irá el simulador visual y el formulario de subida */}
      <p>Aquí podrás subir tu imagen de marca de agua y ajustar su posición, tamaño, opacidad y repeticiones.</p>
    </div>
  );
};

export default WatermarkConfig;
